import React, { Component } from 'react';
import 'assets/css/estilos.css';

import MainStore from 'app/stores/MainStore';
import { cadastrarUsuario } from 'app/actions/CadastroActions';

let cadastrar = nome => {
    console.log("Oi");
}//MainStore.dispatch(cadastrarUsuario(nome));

export class CadastroView extends Component {
    render() {
        return (
            <div>
                <header>
                    <p>Teste</p>
                    <button onClick={console.log("Oi")}>O jogo.</button>
                </header>
            </div>
        );
    }
}
